<script>
    var api_url = 'https://api-lyratec.institutoprominas.com.br/search_courses?certifier=Faculdade ÚNICA';
    var clicked_item = false;

    window.addEventListener('load', function () {

        var form = document.querySelector('form[id="search-autocomplete"]');
        var name_input = form.querySelector('input[name=\'f\']');
        var course_list = document.getElementById('course_list');

        name_input.addEventListener('focus', function () {
            course_list.classList.remove('hide');
        });

        name_input.addEventListener('blur', function () {
            setTimeout(
                function () {
                    if (!clicked_item)
                        course_list.classList.add('hide');
                    else
                        clicked_item = false;
                }, 200
            );
        });

        name_input.addEventListener('keyup', function (event) {
            hinter(event);
        });

        window.hinterXHR = new XMLHttpRequest();
    });

    function hinter(event) {

        var course_name = event.target.value;

        var min_characters = 3;

        if (course_name.length >= min_characters) {

            course_list.innerHTML = '';

            window.hinterXHR.abort();

            window.hinterXHR.onreadystatechange = function () {
                if (this.readyState == 4 && this.status == 200) {

                    var response = JSON.parse(this.responseText);

                    response.data.forEach(function (course) {
                        var item = document.createElement('li');
                        var link = document.createElement('a');

                        link.innerHTML = course.name;
                        link.href = '/pos-graduacao/' + slugify(course.areas[0]) + '/' + course.acronym;

                        item.onclick = function () {
                            clicked_item = true;
                            var form = document.querySelector('form[id="search-autocomplete"]');
                            var name_input = form.querySelector('input[name=\'f\']');
                            name_input.value = course.name;
                            clicked_item = false;
                        };

                        item.appendChild(link);
                        course_list.appendChild(item);
                    });
                }
            };

            var url = api_url + '&type=Pós-Graduação&search=' + course_name;

            var area_input = document.querySelector('select[name=\'course_area\']');

            if (area_input && area_input.value && area_input.value != '*')
                url += '&areas=' + area_input.options[area_input.selectedIndex].innerHTML;

            //console.log(url);

            window.hinterXHR.open('GET', url, true);
            window.hinterXHR.send();
        }
    }
</script>
